import React from 'react';
import Link from 'next/link';
import './header.css';

const logopic = require('./logo.png')
const icon1 = require('./logo.png')
const icon2 = require('./logo.png')
const icon3 = require('./logo.png')

const Header = ({ }) =>
    <div id="header">
        <Link href="/HomePage">
        <div id="headerlogo">
            <img id="logoimg" src={logopic} />
        </div>
        </Link>
        <div id="homeicons">
            <img  src={icon1} />
            <img  src={icon1} />
            <img  src={icon1} />
        </div>
    </div>;

// Home.defaultProps = {

// }

export default Header;
